        res:Capcom dbo:foundingDate ?date .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
SELECT DISTINCT ?uri
WHERE {
        res:Ural_Mountains dbo:highestPlace ?uri .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT DISTINCT ?uri
WHERE {
        ?uri rdf:type dbo:Monarch .
        ?uri dbo:spouse ?spouse .
      { ?spouse dbo:birthPlace res:Germany. }
      UNION
      { ?spouse dbo:birthPlace ?p .
        ?p dbo:country res:Germany. }
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
SELECT DISTINCT ?uri
WHERE {
        ?uri dbo:occupation res:Skateboarding .
      { ?uri dbo:birthPlace res:Sweden . }
      UNION
      { ?uri dbo:birthPlace ?place .
        ?place dbo:country res:Sweden . }
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
SELECT DISTINCT ?uri
WHERE {
        res:The_Prodigy dbo:bandMember ?uri .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
SELECT DISTINCT ?num
WHERE {
        res:Vrije_Universiteit dbo:numberOfStudents ?num .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
SELECT DISTINCT ?uri
WHERE {
        ?uri dbo:type res:Nonprofit_organization .
      { ?uri dbo:locationCountry res:Australia . }
      UNION
      { ?uri dbo:location ?x .
        ?x dbo:country res:Australia . }
}

PREFIX res: <http://dbpedia.org/resource/>
PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT DISTINCT ?uri
WHERE {
        res:Bruce_Carver dbo:deathCause ?uri .
}
